module.exports = JSON.parse('[{"id":1,"title":"Quando comear a reabilitao prottica?","details":"Aps a cirurgia da amputao e aps a alta hospitalar, o paciente dever dar continuidade  fisioterapia num servio especializado. Isto far toda a diferena na reabilitao e no sucesso do programa. A reabilitao de amputados ps-alta hospitalar tem duas etapas  a pr e ps  prottica.","closed":false},{"id":2,"title":"De quanto em quanto tempo eu devo ver meu protesista?","details":" recomendado que faa, no mnimo, uma visita ao ano ao nosso Centro para nos certificarmos que sua prtese permanece segura e funcional. Lembrando que na Da Vinci estamos sempre disponveis via nossos canais de comunicao com o paciente.","closed":true},{"id":3,"title":"Em quanto tempo aps minha amputao de membro inferior conseguirei voltar a andar novamente?","details":"Depende de quo rpida  sua recuperao ps-cirrgica. Uma pessoa saudvel, sem complicaes vasculares e outras comorbidades pode comear sua protetizao em trs a cinco semanas aps a cirurgia.","closed":true},{"id":4,"title":"Quando receberei minha prtese definitiva?","details":"Na Da Vinci, atravs de nosso mtodo Reabilitao 360, prezamos sempre pelo melhor resultado possvel, onde o paciente possa readquirir sua mobilidade, independncia e confiana. Partindo deste princpio, usamos quantos cartuchos de prova forem necessrios, at que o paciente se sinta confortvel e confiante neles. Este processo pode durar de uma a dez semanas.","closed":true},{"id":5,"title":"Quando poderei levar a prtese para casa?","details":"Em paralelo ao treino de marcha o paciente passar por um treinamento especfico de uso e manuseio da prtese, como a colocao correta da mesma e o ajuste da interface liner-prtese atravs de meias,por exemplo.  aconselhvel que o paciente passe em treinamento pelo menos por duas semanas consecutivas, principalmente para aqueles que residem fora da capital ou do estado de So Paulo. O coto de amputao tambm sofre mudanas de volume principalmente neste perodo. Na Da Vinci, aceleramos ao mximo este processo atravs de nosso mtodo Reabilitao 360, para que todos os ajustes necessrios sejam feitos na prtese, assegurando uma adaptao mais rpida ao paciente.","closed":true},{"id":6,"title":"Quanto tempo poderei usar a prtese durante o dia?","details":" aconselhvel que o tempo de uso da prtese ocorra de forma gradativa. Nos pacientes diabticos, os cuidados devem ser redobrados, com verificao constante da pele. Atentar-se a alteraes de cor, presena de flictemas ou bolhas no coto, leses de pele, perda de volume do coto, extremidades e salincias sseas. O treinamento nestes casos, poder ser supervisionado por familiar e/ou cuidador que levar um folheto explicativo de todos os cuidados com o coto e com a prtese. O uso da prtese ocorrer em dois ou trs perodos de forma lenta e gradual, aumentando o tempo de uso e permanncia com a prtese, inserindo aos poucos nas atividades de vida diria. Para os demais pacientes, o uso da prtese ocorrer de forma gradativa, de acordo com a sensibilidade e condicionamento do coto, uma vez que se trata de um novo membro. Este dever ser condicionado desde a primeira etapa da reabilitao. O coto se contrai dentro do encaixe, ativando os diferentes grupos musculares de acordo com a fase de marcha. O paciente poder ter exausto dos msculos do coto no primeiro dia, se exagerar no tempo de uso e na intensidade da atividade praticada com a prtese.","closed":true},{"id":7,"title":"Eu ainda sinto meus dedos mesmo aps minha amputao. Isso  normal?","details":"Sim,  super normal. Sensao fantasma do membro fantasma  comum na maioria dos casos. Se houver muito desconforto, recomendamos que entre em contato com um mdico especialista para saber se h opes de tratamento.","closed":true},{"id":8,"title":"Que tipos de sapatos poderei usar com minhas prteses?","details":"Quase todos os tipos de calados so compatveis com ps protticos. Porm, no caso de diferentes alturas do calcanhar, como saltos altos, ajustes de alinhamento do p so necessrios. Se o paciente for diabtico o tipo de calado depender do grau de comprometimento da sensibilidade protetora do p. Se ele j fizer uso de um calado especial com palmilha termo moldvel feita sob medida, recomenda-se a troca apenas da cor do calado, ou modelo, desde que seja da mesma marca comercial ou feito sob medida.","closed":true},{"id":9,"title":"Como minha prtese se conectar a meu membro amputado?","details":"Na Da Vinci, fabricamos nossos prprios cartuchos a partir de moldes tirados especialmente de cada paciente, capturando perfeitamente o formato e o volume do membro amputado. Aps anlise minuciosa, ser escolhido o tipo de suspenso a ser usado, como suco direta, pino distal ou atravs de liners de suspenso.","closed":true},{"id":10,"title":" comum sentir dor ao usar a prtese?","details":"No. Nosso mtodo Reabilitao 360 contempla passos graduais at que o amputado se acostume 100% com sua prtese. Se estiver sentindo dor, entre em contato conosco imediatamente.","closed":true},{"id":11,"title":"Quanto tempo meu liner, cartucho e componentes devem durar?","details":"Liners tendem a durar de seis meses a um ano, dependo do nvel de cuidado e higiene. Cartuchos podem ter vida til de at quatro anos se no houver mudana brusca de volume do membro amputado. Por fim, diferentes componentes tero durabilidades e garantias distintas. Se tiver quaisquer dvidas em relao a componentes especficos, entre em contato conosco.","closed":true},{"id":12,"title":"Poderei praticar esportes com minha prtese?","details":"Na maioria dos casos o amputado consegue voltar s suas atividades com sua prtese. H alguns esportes, como corrida e natao, que exigem a fabricao de prteses especficas. Entre em contato atravs de nossos canais de comunicao com o paciente; adoraramos te ajudar.","closed":true},{"id":13,"title":"Estou tendo que usar mais meias com minha prtese. Preciso de um novo cartucho?","details":"O uso de meias ajuda no controle da mudana de volume no cartucho. Porm, se o encolhimento do membro amputado persiste,  recomendada a troca de cartucho. Estamos  disposio para uma avaliao gratuita.","closed":true},{"id":14,"title":"Posso tomar banho com minha prtese?","details":"No. A no ser que a prtese seja especfica para banho ou uso na gua.","closed":true},{"id":15,"title":"Posso nadar com minha prtese?","details":"H diversos tipos de prtese feitos especificamente para atividades que envolvem gua e areia. Nossos cartuchos so projetados para abraar o membro amputado perfeitamente, permitindo, na maioria dos casos, o uso em gua tambm. Entre em contato conosco para saber mais","closed":true},{"id":16,"title":"A prtese mais cara  a melhor?","details":"No. Cada paciente tem uma particularidade (tamanho do coto, tipo de cirurgia realizada, presena ou no de espculas sseas, neuromas, capacidade de descarga distal do coto, aderncias, comorbidades) que influenciar na escolha de todos os componentes da prtese, aliada s expectativas e necessidades de cada paciente. Por este motivo, a escolha da prtese s ser possvel aps uma avaliao completa e minuciosa da equipe da clnica. Entre em contato conosco para agendar uma avaliao gratuita.","closed":true}]');

